import './App.css';
import Header from "./Components/Header";
import SignUp from "./Components/SignUp";
import Login from "./Components/Login";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <>
    <Router>
      <Header/>
      <Routes>
          <Route
            exact path="/"
            element={[
                  <SignUp/>,
                  <Login/>]
            }
         /> 
        </Routes>
      </Router>
  </>
  );
}

export default App;
